import React from 'react'
import {
    Link
} from "react-router-dom";

export const Header = () => {
    return (
        <header>
            <div class="header">
                <div class="alignLeft" style={{width: "50%"}}>
                    <span>BUm el logo</span>
                </div>
                <div class="alignRight" style={{width: "50%"}}>
                    <Link to="/login" >Login</Link>
                </div>
            </div>
        </header>
    )
}

export default Header
